(1, '1674817198.jpg', 'WHAT IS INERNATIONAL YOGA ALLIANCE?', 'what-is-inernational-yoga-alliance', '<p>Yoga Alliance Is The Largest Non-Profit Association Representing The Yoga Community, With Over 7,000 Registered Yoga Schools (RYS) And More Than 100,000 Registered Yoga Teachers (RYT). They Foster And Support The High Quality, Safe, Accessible, And Equitable Teaching Of Yoga. Becoming Registered Opens Up Many Doors Into The Community And Being Registered (RYT) First Designation Signifies On Is About To Embark On A Occupational Endeavour. So, If You Are Looking To Set Up Your Own Yoga Studio Or Become A Trainer, This Certification Will Definitely Help You.</p>\r\n', 1, '2023-01-27', '2023-02-14 09:41:12'),
(2, '', 'About Yoga Fettle Journey', 'about-yoga-fettle-journey', '<p>We At Yoga Fettle Journey, Founded By ANIT YOGI Provide To You At Your Convenience The Experienced Professionals And Masters In The Field Of Yoga.</p>\r\n\r\n<p>They Are Especially Skilled To Give Guaranteed Results In Weight Loss, Healthy Pregnancy, Help In Curing Spine Diseases Like Herniated Disk, Muscles Strain, Back Pain, Numbness, Scoliosis, Osteoporosis, Sciatica, Osteoarthritis, Spondylolisthesis And More. Bone Diseases Like Cervical Spondylosis, Degenerative Diseases Of Neck Vertebrae Causing Compression Of Spinal Cord And Cervical Nerves. Also Abdominal, Neuro, Cardiovascular, Reproductive, Hormonal And Many Other Diseases. Transform With Us And Notice Changes Externally And Internally.</p>\r\n\r\n<p>We As A Team Support Our Clients To Bring Lifestyle Changes Which Includes Correcting Postures While Doing Asanas, Nutritional Diet Tips, Opting For Healthy Habits, Cleansing Of Mind Body And Soul And Meditation. Our Body Is The Vessel Which Carries Our Soul In This Lifetime And This Vessel Needs To Be Clean And Healthy In Order To Fulfil Our Life Purpose As Human Beings. We Spend Most Of Our Time With Our Body. Our Body Deserves This Transformation. And We Help TO TAKE YOU INTO THE PRESENT TATE, ONLY PLACE WHERE LIFE EXISTS</p>\r\n', 1, '2023-02-14', '0000-00-00 00:00:00');
