(483, 'Nitin Chaudhary', 'sales@rankinghat.co', '13', 'Re: SEO - Optimization ##', 'Hi, \r\n\r\nHope you are doing well,\r\n\r\nWith your permission I would like to send you an Audit report of your website \"www.yogavoga.in\" with prices showing you a few things to greatly improve these search results for you.\r\n\r\nWould you like me to send pricing/Quote?\r\n\r\nRegards,\r\nNitin Chaudhary | International Project Manager                                                    \r\nEmail:- sales@rankinghat.co            \r\nContact Number:- +1- (209) 813-5119');
