INSERT INTO `testimonials` (`id`, `image`, `name`, `position`, `content`, `status`, `addeddate`, `modifieddate`) VALUES
(2, '', 'Vaishali', 'Student', 'Following a meeting with Guru Anit Ji, my 15-year-long journey into yoga and meditation took an enlightening turn. I realized that my previous understanding of these practices was limited and lacked authenticity. This realization came after completing a specialized course, which emphasized the importance of proper guidance. It has transformed my perspective, deepened my personal practice, and ignited a passion to share this authentic knowledge with others. This journey underscores the value of seeking genuine mentors in yoga and meditation for a truly enriching experience.', 1, '2023-02-07 06:16:19', '2023-10-28 04:25:56'),
(3, '', 'priya', 'Yoga at home student', 'Sukhdev sir is absolutely AMAZING! He works with all levels. I had never done yoga before and He has helped me progress so quickly. He is always on time, pleasant, and so fun to work with!', 1, '2023-02-07 06:17:23', '2023-10-28 04:23:07'),
(4, '', 'Vildan', 'Yoga at home student', 'I’ve been practicing yoga with Amanpreet ma\'am for a while and I can definitely observe noticeable differences in my body – I gained so much flexibility and strength! It’s challenging, but through the clear instructions and consistency of the trainings I can feel great results.', 1, '2023-02-07 06:18:24', '2023-10-28 04:22:45');
INSERT INTO `yogahome` (`id`, `image`, `name`, `slug`, `content`, `showhome`, `status`, `addeddate`, `modifieddate`) VALUES
(50, '1698482233.jpg', 'Yoga at home - Experience the convenience of practicing yoga in the comfort of your home, where our personal yoga instructors tailor sessions to address your unique health needs and accommodate your age.', 'yoga-at-home-experience-the-convenience-of-practicing-yoga-in-the-comfort-of-your-home-where-our-personal-yoga-instructors-tailor-sessions-to-address-your-unique-health-needs-and-accommodate-your-age', '', 0, 1, '2023-02-14 08:56:21', '2023-10-28 02:07:13'),
